import React, { Component } from 'react';
import './bodyChoice.css';

class bodyChoice extends Component {
  render() {
    return (
    <div className="custom-select">
      <form>
    <select name="bodyChoice">
      <option value="volvo">Biceps & Triceps</option>
      <option value="saab">Cardio</option>
      <option value="fiat">Legs</option>
      <option value="audi">Chest & Back</option>
    </select>
    </form>
    </div>
    );
  }
}

export default bodyChoice;
